import './App.css';
//import 'antd/dist/antd.css': // or 'antd/dist/antd.less'
import { DatePicker, Space } from 'antd';
import CustomLayout from './containers/Layout';
//import Login from './components/Login';
//import { renderCloseIcon } from 'antd/es/modal/PurePanel';
import { Breadcrumb, Layout, Menu, Input } from 'antd';
import {HomeFilled} from '@ant-design/icons';

function App() {
  return (
    <div className="App">
      <Space>
      <Menu
        theme="dark"
        mode="horizontal"
        onClick={(info)=>{
          console.log(info.key);
        }}
        defaultSelectedKeys={['dashboard']}
        items={[
          { label:"Home", key:"home", icon:<HomeFilled></HomeFilled> },
          {label:"Dashboard", key:"dashboard"},
          {label:"Login", key:"login"},
          {label:"Signup", key:"Signup"},

          {},
          {},
          {},
          {},
          {},
          {},
          {},
          {},
          {label: <Input.Search placeholder='Search here...'></Input.Search>, key:"search"}
        ]}
      />
      <Menu/>
      </Space>
    </div>
  );
}

export default App;
